import styled from "styled-components";

export const StyleHeader = styled.header`
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 20px 30px;


    div{
        background-color: red;

        a{
            text-decoration: none;
            font-weight: 400;
